import React from 'react';
import './App.css';
import NavTab from './components/navTab';
import Grades from './components/grades';

function App() {

  state = {
    visible: true
  }


  return (
    <div className="App">
      <h1>Gradebook</h1>
      <NavTab/> 
      {this.state.visible ? <Grades/> : null}
    </div>
  );
}

export default App;
